import { useState } from "react";

import axios from "../../DataAccess/AxiosTemp";

function AddressDtlOfVoter() {


    const[userAddress,setuserAddress] = useState({
        email: "",
        state: "",
        country: "",
        region: "",
        district: "",
        city: "",
        pincode: 0
      });

      useEffect(() => {

        axios.get('/api/options')
          .then(response => {
            setOptions(response.data);
          })
          .catch(error => {
            console.error('Error fetching options:', error);
          });
      }, []);


      const userAddresschange = (args) => {
        var copyofaddress = { ...userAddress };

        copyofaddress[args.target.name] = args.target.value;
        setuserAddress(copyofaddress);
      }
      userAddress.email = localStorage.getItem("emailforVoterAddressAddUses");

      const addAddress = async () => {
        try {
          const result = await axios.post('/authorize/signupforvoter', userAddress, {
            headers: {
              'Content-Type': 'application/json',
            },
          })


        }
        catch (error) {
          console.log("Error Occured" + error);
        }
      }

    return<>

        <div> 
            <div className="jumbotron" style={{backgroundColor:'rgb(250, 248, 228)'}} >
                <center><h1>Voter Sign Up</h1></center>     
                <center><h2>Enter Details</h2></center>     
                <center><h2>2/2</h2></center>     
            </div>  
        </div>




    <div className="container-fluid text-center"> 

  <div className="row content">
    <div className="col-lg-5 sidenav">

    <div>
    <div><center><big>Conutry</big></center></div>
    <input type="text" placeholder="Enter First Name" className="form-control" name="country" value={userAddress.country} onChange={userAddresschange}></input>
    </div>

    <br></br>
    <div>
    <div><center><big>State</big></center></div>
    <input type="text" placeholder="Enter Last Name" className="form-control" name="state" value={userAddress.state} onChange={userAddresschange}></input>
    </div>

    <br></br>
    <div>
    <div><center><big>District</big></center></div>
    <input type="text" placeholder="District" className="form-control" name="district" value={userAddress.district} onChange={userAddresschange}></input>
    </div>

    <br></br>
    <div>
    <div><center><big>City</big></center></div>
    <input type="number" placeholder="Enter A Valid Id number" className="form-control" name="city" value={userAddress.city} onChange={userAddresschange}></input>
    </div>


    </div>
    <div className="col-lg-2 text-center"> 

    </div>
    <div className="col-lg-5 sidenav">



    <div>
    <div><center><big>Pincode</big></center></div>
    <input type="number" placeholder="Enter the Password" className="form-control" name="pincode" value={userAddress.pincode} onChange={userAddresschange}></input>
    </div>

    <br></br>Select The Region<br></br><br></br>
    <select class="form-select form-select-lg lg-3" aria-label=".form-select-lg example">
        <option selected disabled>Open this select menu</option>
        <option value="1">Get</option>
        <option value="2">data</option>
        <option value="3">from</option>
        <option value="3">db</option>
    </select>



    </div>
  </div>
  <br></br><br></br>
  <div><button type="button" class="btn btn-success">Next</button></div>
</div>


    </>
}

export default AddressDtlOfVoter;
